settings._cssCustom:
.c-clickable-card {
  position: relative;
  transition: .25s ease-in-out;
}

.c-clickable-card h3 a::before {
  content: '';
  position: absolute;
  inset: 0;
  z-index: 1;
}

.c-clickable-card:focus-within {
  outline-style: solid;
  outline-width: 2px;
  outline-color: black;
}

.c-clickable-card:focus-within :focus {
  box-shadow: none;
  outline: none;
}

.c-main-nav__mini-cart a.button.wc-forward {
  background-color: transparent !important;
  color: var(--button-color) !important;
  border-color: var(--button-color);
  border-width: var(--button-border-width);
  border-style: solid;
}

.c-main-nav__mini-cart a.button.wc-forward:hover {
  background-color: transparent !important;
  color: var(--button-color--hover) !important;
  border-color: var(--button-color--hover);
}

.c-main-nav__mini-cart a.button.checkout.wc-forward {
  background-color: var(--button-color) !important;
  color: var(--button-text-color--filled) !important;
}

.c-main-nav__mini-cart a.button.checkout.wc-forward:hover {
  background-color: var(--button-color--hover) !important;
  color: var(--button-text-color--filled) !important;
}

.c-testimonial-card__testimonial-wrapper {
	position: relative;
}

.c-testimonial-card__testimonial-wrapper::before {
  position: absolute;
  content: '';
  background-image: url("https://nobrainisthesame.org/wp-content/uploads/2024/07/quotation-mark.svg");
  height: 40px;
  width: 40px;
  background-repeat: no-repeat;
  background-size: contain;
  top: -40px;

}

.c-testimonial-card__testimonial-wrapper::after {
   position: absolute;
  content: '';
  background-image: url("https://nobrainisthesame.org/wp-content/uploads/2024/07/quotation-mark.svg");
  height: 25px;
  width: 40px;
  background-repeat: no-repeat;
  background-size: contain;
  bottom: -40px;
  right: 0px;
  transform: rotate(180deg);

}
